import React from 'react';
import s from './Footer.module.css';

const Footer = () => {
  return (
      <div className={s.footer}>
        <div className={s.copyright}>
          <p>2021 - 2022 all right reserved design by FORTRIX</p>
        </div>
      </div>
  );
};

export default Footer;
